<div id=""nps-parallax"">

    <section class=""block"">
        <div class=""container"">
            <div class=""title"">
                <h1>""It was here that the romance of my life began.""</h1>
                <h3>- Theodore Roosevelt</h3>
            </div>
        </div>
    </section>

    <section>
        <div class=""parallax-one"">
            <div class=""container""><h2>Arches National Park<br />(Utah)</h2></div>
        </div>
    </section>

    <section class=""block"">
            <div class=""container"">
                <p><span class=""first-character ut"">B</span>y the <a href=""https://www.ourdocuments.gov/doc.php?flash=false&doc=45>"">Act of March 1, 1872</a>, Congress established Yellowstone National Park in the Territories of Montana and Wyoming ""as a public park or pleasuring-ground for the benefit and enjoyment of the people"" and placed it ""under exclusive control of the Secretary of the Interior."" </p>

                <h4>The founding of Yellowstone National Park began a wor");
            WriteLiteral(@"ldwide national park movement. </h4>

                <p>Today more than 100 nations contain some 1,200 national parks or equivalent preserves.</p>

                <p>In the years following the establishment of Yellowstone, the United States authorized additional national parks and monuments, many of them carved from the federal lands of the West. These, also, were administered by the Department of the Interior, while other monuments and natural and historical areas were administered by the War Department and the Forest Service of the Department of Agriculture.</p>

                <h4 class=""margin-top-10"">No single agency provided unified management of the varied federal parklands. </h4>
        </div>
    </section>

    <section>
        <div class=""parallax-two"">
            <div class=""container""><h2>Yosemite National Park<br />(California)</h2></div>
        </div>
    </section>

    <section class=""block"">
        <div class=""container"">
            <p>
                <span class");
            WriteLiteral(@"=""first-character ca"">O</span>n August 25, 1916, President Woodrow Wilson signed the act creating the
                National Park Service, a new federal bureau in the Department of the Interior responsible for protecting the 35
                national parks and monuments then managed by the department and those yet to be established.
            </p>

            <p>
                This <a href=""https://www.nps.gov/parkhistory/online_books/anps/anps_1i.htm"">""Organic Act""</a> states that
                ""the Service thus established shall promote and regulate the use of the Federal areas
                known as national parks, monuments and reservations…by such means and measures as conform to the fundamental purpose
                of the said parks, monuments and reservations, which purpose is to conserve the scenery and the natural and historic
                objects and the wild life therein and to provide for the enjoyment of the same in such manner and by such means as will
             ");
            WriteLiteral(@"   leave them unimpaired for the enjoyment of future generations.""
            </p>

            <p>
                An <a href=""https://www.nps.gov/parkhistory/online_books/anps/anps_3b.htm"">Executive Order in 1933</a> transferred 56
                national monuments and military sites from the Forest Service and the War Department to the National Park Service.
                This action was a major step in the development of today's truly national system of parks—a system that includes
                areas of historical as well as scenic and scientific importance.
            </p>
        </div>
    </section>

    <section>
        <div class=""parallax-three"">
            <div class=""container""><h2>Vietnam Veterans Memorial And Washington Monument<br />(Washington, D.C.)</h2></div>
        </div>
    </section>

    <section class=""block"">
        <div class=""container"">
            <p>
                <span class=""first-character dc"">C</span>ongress declared in the
               ");
            WriteLiteral(@" <a href=""https://www.nps.gov/parkhistory/online_books/anps/anps_7a.htm"">General Authorities Act of 1970</a>
                ""that the National Park System, which began with the establishment of Yellowstone National Park in 1872,
                has since grown to include superlative natural, historic, and recreation areas in every region…and that
                it is the purpose of this Act to include all such areas in the System….""
            </p>

            <h4 class=""margin-top-10"">
                The National Park System of the United States now comprises more than 400 areas
                covering more than 84 million acres in 50 states, the District of Columbia,
                American Samoa, Guam, Puerto Rico, Saipan, and the Virgin Islands.
            </h4>

            <p>
                These areas are of such national significance as to justify special
                recognition and protection in accordance with various acts of Congress.
            </p>
        </div>
 ");
            WriteLiteral(@"   </section>
    <section>
        <div class=""parallax-four"">
            <div class=""container""><h2>Grand Canyon National Park<br />(Arizona)</h2></div>
        </div>
    </section>
    <section class=""block"">
        <div class=""container"">
            <p>
                <span class=""first-character az"">A</span>dditions to the National Park System are now
                generally made through acts of Congress, and national parks can be created only through such acts.
            </p>
            <br />
            <p class=""margin-top-10"">
                But the President has authority, under the
                <a href=""https://www.nps.gov/subjects/legal/american-antiquities-act-of-1906.htm"">Antiquities Act of 1906</a>,
                to proclaim national monuments on lands already under federal jurisdiction.
            </p>

            <p>
            The Secretary of the Interior is usually asked by Congress for recommendations on proposed
            additions to the System");
            WriteLiteral(@". The Secretary is counseled by the National Park System Advisory Board,
