            <p>
                <span class=""first-character ma"">T</span>he National Park Service still strives to meet its original goals,
                while filling many other roles as well:
            </p>
            <ul>
                <li>guardian of our diverse cultural and recreational resources</li>
                <li>environmental advocate</li>
                <li>partner in <a href=""https://www.nps.gov/getinvolved/communities.htm"">community revitalization</a></li>
                <li>world leader in the parks and pre");
